INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 0, 60000, "カリン", 1, 1);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 1, 0, "", 0, 60000, "", 1, 2);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 1, 0, "", 0, 60000, "", 1, 3);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 1, 0, "", 0, 60000, "", 2, 4);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 2, 0, "", 0, 60000, "", 1, 5);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 2, 0, "", 0, 60000, "", 1, 6);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 2, 0, "", 0, 60000, "", 2, 7);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 3, 0, "", 0, 60000, "", 1, 8);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 3, 0, "", 0, 60000, "", 1, 9);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 3, 0, "", 0, 60000, "", 1, 10);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 3, 0, "", 0, 60000, "", 1, 11);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 3, 0, "", 0, 60000, "", 2, 12);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 4, 0, "", 0, 60000, "", 1, 13);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 4, 0, "", 0, 60000, "", 1, 14);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 4, 0, "", 0, 60000, "", 1, 15);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 4, 0, "", 0, 60000, "", 1, 16);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 4, 0, "", 0, 60000, "", 2, 17);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 0, "", 0, 60000, "カリン", 0, 18);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, 0, "", 7, 60000, "カリン", 0, 19);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 101201, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 0, 0, "", 1, 80001, "ハツネ", 0, 20);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 101201, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 0, 0, "", 1, 80001, "ハツネ", 0, 21);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103801, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 0, 0, "", 1, 80001, "シオリ", 0, 22);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103801, "来年も、\n一緒にいられたら…\nうれしいな", 1, 0, 0, "", 1, 80001, "シオリ", 0, 23);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103601, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 0, 0, "", 2, 80001, "キョウカ", 0, 24);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103601, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 0, 0, "", 2, 80001, "キョウカ", 0, 25);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102001, "おにいちゃんとあってから、\n1年たったよ～！", 1, 0, 0, "", 2, 80001, "ミミ", 0, 26);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 1, 0, 0, "", 2, 80001, "ミミ", 0, 27);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100401, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 0, 0, "", 2, 80001, "ミソギ", 0, 28);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100401, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 0, 0, "", 2, 80001, "ミソギ", 0, 29);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 101001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 0, 0, "", 3, 80001, "マホ", 0, 30);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 101001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 0, 0, "", 3, 80001, "マホ", 0, 31);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104401, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 0, 0, "", 3, 80001, "イリヤ", 0, 32);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104401, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 1, 0, 0, "", 3, 80001, "イリヤ", 0, 33);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 101701, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 2, 0, 0, "", 3, 80001, "カオリ", 0, 34);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 101701, "これからも、どうぞよろしく\nお願いするさ～！", 2, 0, 0, "", 3, 80001, "カオリ", 0, 35);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102801, "あんたと出会ってからもうそんなに\nたつのね～", 0, 0, 0, "", 4, 80001, "サレン", 0, 36);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102801, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 0, 0, "", 4, 80001, "サレン", 0, 37);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102501, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 0, 0, "", 4, 80001, "スズメ", 0, 38);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102501, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 1, 0, 0, "", 4, 80001, "スズメ", 0, 39);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104601, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 0, 0, "", 5, 80001, "タマキ", 0, 40);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104601, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 0, 0, "", 5, 80001, "タマキ", 0, 41);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104801, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 0, 0, "", 5, 80001, "ミフユ", 0, 42);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104801, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 1, 0, 0, "", 5, 80001, "ミフユ", 0, 43);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103201, "あなたさまと出会ってもう1年…", 0, 0, 0, "", 6, 80001, "アキノ", 0, 44);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103201, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 0, 0, "", 6, 80001, "アキノ", 0, 45);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103401, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 0, 0, "", 6, 80001, "ユカリ", 0, 46);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103401, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 1, 0, 0, "", 6, 80001, "ユカリ", 0, 47);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 107101, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 0, 0, "", 7, 80001, "クリスティーナ", 0, 48);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 107101, "ともかくこれからも\n愉しませてくれよ☆", 0, 0, 0, "", 7, 80001, "クリスティーナ", 0, 49);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104701, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 0, 0, "", 7, 80001, "ジュン", 0, 50);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104701, "見えないから分からないって？\nそれもそうだな…", 1, 0, 0, "", 7, 80001, "ジュン", 0, 51);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103701, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 0, 0, "", 8, 80001, "トモ", 0, 52);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103701, "これからもよろしくね！", 0, 0, 0, "", 8, 80001, "トモ", 0, 53);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100501, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 0, 0, "", 8, 80001, "マツリ", 0, 54);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100501, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 1, 0, 0, "", 8, 80001, "マツリ", 0, 55);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100701, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 0, 0, "", 9, 80001, "ミヤコ", 0, 56);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100701, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 0, 0, "", 9, 80001, "ミヤコ", 0, 57);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 103101, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 0, 0, "", 9, 80001, "シノブ", 0, 58);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 103101, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 1, 0, 0, "", 9, 80001, "シノブ", 0, 59);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100901, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 0, 0, "", 10, 80001, "アンナ", 0, 60);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100901, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 0, 0, "", 10, 80001, "アンナ", 0, 61);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 101301, "君と出会ってもう1年だって！\n早いねー！", 1, 0, 0, "", 10, 80001, "ナナカ", 0, 62);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 101301, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 1, 0, 0, "", 10, 80001, "ナナカ", 0, 63);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105101, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 0, 0, "", 11, 80001, "ミツキ", 0, 64);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105101, "これからも、いろんなところを\n調べさせてね？", 0, 0, 0, "", 11, 80001, "ミツキ", 0, 65);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105601, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 0, 0, "", 11, 80001, "ルカ", 0, 66);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105601, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 1, 0, 0, "", 11, 80001, "ルカ", 0, 67);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102701, "早いものですわね、あなた様と\nお会いして、もう1年…", 2, 0, 0, "", 11, 80001, "エリコ", 0, 68);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102701, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 0, 0, "", 11, 80001, "エリコ", 0, 69);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102301, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 0, 0, "", 12, 80001, "アヤネ", 0, 70);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102301, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 0, 0, "", 12, 80001, "アヤネ", 0, 71);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104201, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 0, 0, "", 12, 80001, "チカ", 0, 72);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104201, "私のことを見守ってください\nできることなら、ずっと…", 1, 0, 0, "", 12, 80001, "チカ", 0, 73);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 102101, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 2, 0, 0, "", 12, 80001, "クルミ", 0, 74);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 102101, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 0, 0, "", 12, 80001, "クルミ", 0, 75);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 104901, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 0, 0, "", 13, 80001, "シズル", 0, 76);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 104901, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 0, 0, "", 13, 80001, "シズル", 0, 77);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 101101, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 0, 0, "", 13, 80001, "リノ", 0, 78);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 101101, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 1, 0, 0, "", 13, 80001, "リノ", 0, 79);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100201, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 0, 0, "", 14, 80001, "ユイ", 0, 80);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100201, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 0, 0, "", 14, 80001, "ユイ", 0, 81);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100101, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 0, 0, "", 14, 80001, "ヒヨリ", 0, 82);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100101, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 1, 0, 0, "", 14, 80001, "ヒヨリ", 0, 83);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 100301, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 2, 0, 0, "", 14, 80001, "レイ", 0, 84);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 100301, "キミに背中を預けられる日が、\n早くきますように", 2, 0, 0, "", 14, 80001, "レイ", 0, 85);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105801, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 0, 0, "", 15, 80001, "ペコリーヌ", 0, 86);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105801, "これからもずっと、覚えていて\nくださいね！", 0, 0, 0, "", 15, 80001, "ペコリーヌ", 0, 87);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105901, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 0, 0, "", 15, 80001, "コッコロ", 0, 88);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105901, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 1, 0, 0, "", 15, 80001, "コッコロ", 0, 89);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 106001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 2, 0, 0, "", 15, 80001, "キャル", 0, 90);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 106001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 0, 0, "", 15, 80001, "キャル", 0, 91);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 112101, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, 0, "", 0, 60001, "スズメ", 1, 92);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 1, 0, "", 0, 60001, "", 1, 93);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 1, 0, "", 0, 60001, "", 1, 94);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 1, 0, "", 0, 60001, "", 1, 95);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 1, 0, "", 0, 60001, "", 1, 96);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 1, 0, "", 0, 60001, "", 2, 97);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 2, 0, "", 0, 60001, "", 1, 98);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 2, 0, "", 0, 60001, "", 1, 99);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 2, 0, "", 0, 60001, "", 1, 100);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 2, 0, "", 0, 60001, "", 1, 101);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 2, 0, "", 0, 60001, "", 2, 102);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 3, 0, "", 0, 60001, "", 1, 103);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 3, 0, "", 0, 60001, "", 1, 104);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 3, 0, "", 0, 60001, "", 1, 105);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 3, 0, "", 0, 60001, "", 1, 106);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 2, 3, 0, "", 0, 60001, "", 1, 107);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 2, 3, 0, "", 0, 60001, "", 1, 108);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 3, 0, "", 0, 60001, "", 2, 109);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 4, 0, "", 0, 60001, "", 1, 110);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 4, 0, "", 0, 60001, "", 1, 111);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 4, 0, "", 0, 60001, "", 1, 112);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 4, 0, "", 0, 60001, "", 1, 113);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 4, 0, "", 0, 60001, "", 1, 114);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 2, 4, 0, "", 0, 60001, "", 1, 115);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 4, 0, "", 0, 60001, "", 2, 116);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 112101, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 3, 0, 0, "", 0, 60001, "スズメ", 0, 117);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 112101, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 0, 0, "", 7, 60001, "スズメ", 0, 118);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105801, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 0, 0, "", 1, 80003, "ペコリーヌ", 0, 119);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105901, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 0, 0, "", 1, 80003, "コッコロ", 0, 120);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105901, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 0, 0, "", 1, 80003, "コッコロ", 0, 121);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 106001, "え？　ちょっと\nいきなりなにっ？", 2, 0, 0, "", 1, 80003, "キャル", 0, 122);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 106001, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 0, 0, "", 1, 80003, "キャル", 0, 123);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105801, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 0, 0, "", 1, 80003, "ペコリーヌ", 0, 124);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 105801, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 0, 0, "", 1, 80003, "ペコリーヌ", 0, 125);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 105901, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 0, 0, "", 1, 80003, "コッコロ", 0, 126);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 106001, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 2, 0, 0, "", 1, 80003, "キャル", 0, 127);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 105901, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 0, 0, "", 1, 80003, "コッコロ", 0, 128);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 105801, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 0, 0, "", 1, 80003, "ペコリーヌ", 0, 129);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 106001, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 2, 0, 0, "", 1, 80003, "キャル", 0, 130);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 105901, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 0, 0, "", 1, 80003, "コッコロ", 0, 131);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 106001, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 0, 0, "", 2, 80003, "キャル", 0, 132);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 190801, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 0, 0, "", 2, 80003, "カリン", 0, 133);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 106001, "げっ…カリンじゃない\nなんでもないわよ！", 0, 0, 0, "", 2, 80003, "キャル", 0, 134);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 190801, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 1, 0, 0, "", 2, 80003, "カリン", 0, 135);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 106001, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 0, 0, "", 2, 80003, "キャル", 0, 136);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 190801, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 1, 0, 0, "", 2, 80003, "カリン", 0, 137);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 106001, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 0, 0, "", 2, 80003, "キャル", 0, 138);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 106001, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 0, 0, "", 2, 80003, "キャル", 0, 139);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 190801, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 1, 0, 0, "", 2, 80003, "カリン", 0, 140);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 106001, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 0, 0, "", 2, 80003, "キャル", 0, 141);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 190801, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 1, 0, 0, "", 2, 80003, "カリン", 0, 142);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 106001, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 0, 0, "", 2, 80003, "キャル", 0, 143);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 105901, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 144);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 105801, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 145);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 105901, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 146);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 105901, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 147);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 105801, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 148);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 105801, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 149);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 105901, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 150);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 105801, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 151);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 105901, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 152);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 105801, "えへへ、ありがとうございます\nコッコロちゃん！", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 153);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 105901, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 0, 0, "", 3, 80003, "コッコロ", 0, 154);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 105801, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 1, 0, 0, "", 3, 80003, "ペコリーヌ", 0, 155);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 105801, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 156);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 106001, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 1, 0, 0, "", 4, 80003, "キャル", 0, 157);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 105801, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 158);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 106001, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 1, 0, 0, "", 4, 80003, "キャル", 0, 159);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 105801, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 160);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 106001, "…積極的？\nなんの話よ？", 1, 0, 0, "", 4, 80003, "キャル", 0, 161);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 105801, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 162);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 105801, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 163);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 106001, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 1, 0, 0, "", 4, 80003, "キャル", 0, 164);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 105801, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 0, 0, "", 4, 80003, "ペコリーヌ", 0, 165);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 106001, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 1, 0, 0, "", 4, 80003, "キャル", 0, 166);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 106001, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 1, 0, 0, "", 4, 80003, "キャル", 0, 167);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 106001, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 0, 0, "", 5, 80003, "キャル", 0, 168);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 105901, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 1, 0, 0, "", 5, 80003, "コッコロ", 0, 169);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 106001, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 0, 0, "", 5, 80003, "キャル", 0, 170);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 105901, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 1, 0, 0, "", 5, 80003, "コッコロ", 0, 171);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 106001, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 0, 0, "", 5, 80003, "キャル", 0, 172);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 105901, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 1, 0, 0, "", 5, 80003, "コッコロ", 0, 173);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 106001, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 0, 0, "", 5, 80003, "キャル", 0, 174);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 105901, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 1, 0, 0, "", 5, 80003, "コッコロ", 0, 175);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 106001, "かくし芸？", 0, 0, 0, "", 5, 80003, "キャル", 0, 176);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 105901, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 1, 0, 0, "", 5, 80003, "コッコロ", 0, 177);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 106001, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 0, 0, "", 5, 80003, "キャル", 0, 178);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 105801, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 0, 0, "", 6, 80003, "ペコリーヌ", 0, 179);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 106001, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 2, 0, 0, "", 6, 80003, "キャル", 0, 180);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 105901, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 1, 0, 0, "", 6, 80003, "コッコロ", 0, 181);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 105801, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 0, 0, "", 6, 80003, "ペコリーヌ", 0, 182);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 106001, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 2, 0, 0, "", 6, 80003, "キャル", 0, 183);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 105901, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 1, 0, 0, "", 6, 80003, "コッコロ", 0, 184);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 106001, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 2, 0, 0, "", 6, 80003, "キャル", 0, 185);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 106001, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 2, 0, 0, "", 6, 80003, "キャル", 0, 186);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 106001, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 2, 0, 0, "", 6, 80003, "キャル", 0, 187);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 105801, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 0, 0, "", 6, 80003, "ペコリーヌ", 0, 188);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 105901, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 1, 0, 0, "", 6, 80003, "コッコロ", 0, 189);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 106001, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 2, 0, 0, "", 6, 80003, "キャル", 0, 190);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 106001, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 0, 0, "", 7, 80003, "キャル", 0, 191);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 106001, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 0, 0, "", 7, 80003, "キャル", 0, 192);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 106001, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 0, 0, "", 7, 80003, "キャル", 0, 193);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 106001, "あー\nあー\n…声、これで大丈夫かしら？", 0, 0, 0, "", 7, 80003, "キャル", 0, 194);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 106001, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 0, 0, "", 7, 80003, "キャル", 0, 195);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 106001, "オイッスー☆", 0, 0, 0, "", 7, 80003, "キャル", 0, 196);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 106001, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 0, 0, "", 7, 80003, "キャル", 0, 197);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 106001, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 0, 0, "", 7, 80003, "キャル", 0, 198);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 106001, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 0, 0, "", 7, 80003, "キャル", 0, 199);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 105901, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 200);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 105901, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 201);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 105901, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 202);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 105901, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 203);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 105901, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 204);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 105901, "オイッスー☆", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 205);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 105901, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 206);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 105901, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 207);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 105901, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 0, 0, "", 8, 80003, "コッコロ", 0, 208);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 105801, "オイッスー☆", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 209);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 105801, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 210);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 105801, "あと６日で2.5周年ですか…", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 211);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 105801, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 212);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 105801, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 213);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 105801, "オイッスー☆", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 214);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 105801, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 215);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 105801, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 216);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 105801, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 217);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 105801, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 218);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 105801, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 0, 0, "", 9, 80003, "ペコリーヌ", 0, 219);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 105801, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 220);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 105901, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 1, 0, 0, "", 10, 80003, "コッコロ", 0, 221);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 105801, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 222);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 106001, "…………", 2, 0, 0, "", 10, 80003, "キャル", 0, 223);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 105901, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 1, 0, 0, "", 10, 80003, "コッコロ", 0, 224);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 106001, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 2, 0, 0, "", 10, 80003, "キャル", 0, 225);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 105801, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 226);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 106001, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 2, 0, 0, "", 10, 80003, "キャル", 0, 227);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 105801, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 228);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 105801, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 229);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 106001, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 2, 0, 0, "", 10, 80003, "キャル", 0, 230);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 105901, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 1, 0, 0, "", 10, 80003, "コッコロ", 0, 231);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 106001, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 2, 0, 0, "", 10, 80003, "キャル", 0, 232);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 105801, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 0, 0, "", 10, 80003, "ペコリーヌ", 0, 233);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 190801, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 0, 0, "", 11, 80003, "カリン", 0, 234);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 190801, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 0, 0, "", 11, 80003, "カリン", 0, 235);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 190801, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 0, 0, "", 11, 80003, "カリン", 0, 236);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 190801, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 0, 0, "", 11, 80003, "カリン", 0, 237);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 190801, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 0, 0, "", 11, 80003, "カリン", 0, 238);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 190801, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 0, 0, "", 11, 80003, "カリン", 0, 239);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 190801, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 0, 0, "", 11, 80003, "カリン", 0, 240);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 190801, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 0, 0, "", 11, 80003, "カリン", 0, 241);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 190801, "あれ？\nもしかして緊張で気を失って…？", 0, 0, 0, "", 11, 80003, "カリン", 0, 242);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 190801, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 0, 0, "", 11, 80003, "カリン", 0, 243);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 190801, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 0, 0, "", 11, 80003, "カリン", 0, 244);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 190801, "それでは\nまた明日お会いしましょう♪", 0, 0, 0, "", 11, 80003, "カリン", 0, 245);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 106001, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 0, 0, "", 12, 80003, "キャル", 0, 246);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 105801, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 2, 0, 0, "", 12, 80003, "ペコリーヌ", 0, 247);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 105901, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 1, 0, 0, "", 12, 80003, "コッコロ", 0, 248);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (45, 106001, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 0, 0, "", 12, 80003, "キャル", 0, 249);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 105801, "ひどいですよぉキャルちゃ～ん！", 2, 0, 0, "", 12, 80003, "ペコリーヌ", 0, 250);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 105901, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 1, 0, 0, "", 12, 80003, "コッコロ", 0, 251);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 105801, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 2, 0, 0, "", 12, 80003, "ペコリーヌ", 0, 252);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (46, 106001, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 0, 0, "", 12, 80003, "キャル", 0, 253);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 105901, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 1, 0, 0, "", 12, 80003, "コッコロ", 0, 254);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 105801, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 2, 0, 0, "", 12, 80003, "ペコリーヌ", 0, 255);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 105801, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 256);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (47, 106001, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 2, 0, 0, "", 13, 80003, "キャル", 0, 257);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 105801, "忘れてきちゃいました☆", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 258);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (48, 106001, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 2, 0, 0, "", 13, 80003, "キャル", 0, 259);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 105901, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 1, 0, 0, "", 13, 80003, "コッコロ", 0, 260);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (49, 106001, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 2, 0, 0, "", 13, 80003, "キャル", 0, 261);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 105801, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 262);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (50, 106001, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 2, 0, 0, "", 13, 80003, "キャル", 0, 263);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 105901, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 1, 0, 0, "", 13, 80003, "コッコロ", 0, 264);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (51, 106001, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 2, 0, 0, "", 13, 80003, "キャル", 0, 265);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 105901, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 1, 0, 0, "", 13, 80003, "コッコロ", 0, 266);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (52, 106001, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 2, 0, 0, "", 13, 80003, "キャル", 0, 267);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 105801, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 268);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 105901, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 1, 0, 0, "", 13, 80003, "コッコロ", 0, 269);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (45, 105801, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 270);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (53, 106001, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 2, 0, 0, "", 13, 80003, "キャル", 0, 271);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (46, 105801, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 0, 0, "", 13, 80003, "ペコリーヌ", 0, 272);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 190801, "こんにちは\n【ギルド管理協会】のカリンです", 0, 0, 0, "", 14, 80003, "カリン", 0, 273);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 190801, "昨日の生放送は\nいかがだったでしょうか？", 0, 0, 0, "", 14, 80003, "カリン", 0, 274);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 190801, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 0, 0, "", 14, 80003, "カリン", 0, 275);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 190801, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 0, 0, "", 14, 80003, "カリン", 0, 276);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 190801, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 0, 0, "", 14, 80003, "カリン", 0, 277);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 190801, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 0, 0, "", 14, 80003, "カリン", 0, 278);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 190801, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 0, 0, "", 14, 80003, "カリン", 0, 279);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 190801, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 0, 0, "", 14, 80003, "カリン", 0, 280);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 190801, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 0, 0, "", 14, 80003, "カリン", 0, 281);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 190801, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 0, 0, "", 14, 80003, "カリン", 0, 282);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (47, 105801, "準備はいいですかっ？\n…いっきますよー！", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 283);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (54, 106001, "祝！", 2, 0, 0, "", 15, 80003, "キャル", 0, 284);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 105901, "2.5周年！", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 285);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (48, 105801, "おめでとうございま～す☆", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 286);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (55, 106001, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 2, 0, 0, "", 15, 80003, "キャル", 0, 287);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 105901, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 288);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (49, 105801, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 289);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (56, 106001, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 2, 0, 0, "", 15, 80003, "キャル", 0, 290);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 105901, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 291);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (57, 106001, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 2, 0, 0, "", 15, 80003, "キャル", 0, 292);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (50, 105801, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 293);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (58, 106001, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 2, 0, 0, "", 15, 80003, "キャル", 0, 294);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (51, 105801, "記念日だから\n平気平気♪\nやばいですね☆", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 295);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (59, 106001, "意味分かんないわよ！", 2, 0, 0, "", 15, 80003, "キャル", 0, 296);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 105901, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 297);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 105901, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 298);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (52, 105801, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 299);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (60, 106001, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 2, 0, 0, "", 15, 80003, "キャル", 0, 300);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 105901, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 1, 0, 0, "", 15, 80003, "コッコロ", 0, 301);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (53, 105801, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 0, 0, "", 15, 80003, "ペコリーヌ", 0, 302);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (54, 105801, "2.5周年\nありがとうございます！", 0, 0, 1, "105901,45,106001,61", 15, 80003, "ペコリーヌ・コッコロ・キャル", 0, 303);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 0, 60002, "カリン", 1, 304);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 1, 0, "", 0, 60002, "", 1, 305);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 1, 0, "", 0, 60002, "", 1, 306);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 1, 0, "", 0, 60002, "", 1, 307);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 1, 0, "", 0, 60002, "", 1, 308);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 1, 0, "", 0, 60002, "", 2, 309);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 2, 0, "", 0, 60002, "", 1, 310);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 2, 0, "", 0, 60002, "", 1, 311);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 2, 0, "", 0, 60002, "", 1, 312);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 2, 0, "", 0, 60002, "", 1, 313);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 2, 0, "", 0, 60002, "", 2, 314);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 3, 0, "", 0, 60002, "", 1, 315);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 3, 0, "", 0, 60002, "", 1, 316);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 3, 0, "", 0, 60002, "", 1, 317);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 3, 0, "", 0, 60002, "", 1, 318);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 2, 3, 0, "", 0, 60002, "", 1, 319);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 3, 0, "", 0, 60002, "", 1, 320);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 3, 0, "", 0, 60002, "", 2, 321);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 4, 0, "", 0, 60002, "", 1, 322);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 4, 0, "", 0, 60002, "", 1, 323);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 4, 0, "", 0, 60002, "", 1, 324);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 4, 0, "", 0, 60002, "", 1, 325);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 4, 0, "", 0, 60002, "", 1, 326);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 4, 0, "", 0, 60002, "", 1, 327);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 4, 0, "", 0, 60002, "", 2, 328);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 0, "", 0, 60002, "カリン", 0, 329);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, 0, "", 7, 60002, "カリン", 0, 330);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105901, "ささ、シェフィさまはこちらへ…", 4, 0, 0, "", 1, 80005, "コッコロ", 0, 331);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 106401, "コッコロさん、どこへ行くの…？\n…え？", 0, 0, 0, "", 1, 80005, "シェフィ", 0, 332);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 105801, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 3, 0, 0, "", 1, 80005, "ペコリーヌ", 0, 333);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105901, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 4, 0, 0, "", 1, 80005, "コッコロ", 0, 334);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 106401, "ええと…\n二人とも何をしているの？", 0, 0, 0, "", 1, 80005, "シェフィ", 0, 335);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 106001, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 0, 0, "", 1, 80005, "キャル", 0, 336);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 106401, "あの日…？", 0, 0, 0, "", 1, 80005, "シェフィ", 0, 337);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 105801, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 3, 0, 0, "", 1, 80005, "ペコリーヌ", 0, 338);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 105801, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 0, 0, "", 1, 80005, "ペコリーヌ", 0, 339);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 190801, "やばいですね☆", 2, 0, 0, "", 1, 80005, "カリン", 0, 340);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 106001, "って、なにしれっと\n参加してんのよカリン！", 1, 0, 0, "", 1, 80005, "キャル", 0, 341);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (2, 190801, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 0, 0, "", 1, 80005, "カリン", 0, 342);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 190801, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 2, 0, 0, "", 1, 80005, "カリン", 0, 343);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 105801, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 3, 0, 0, "", 1, 80005, "ペコリーヌ", 0, 344);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 106401, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 0, 0, "", 1, 80005, "シェフィ", 0, 345);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 105801, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 3, 0, 0, "", 2, 80005, "ペコリーヌ", 0, 346);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 105901, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 1, 0, 0, "", 2, 80005, "コッコロ", 0, 347);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 105901, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 1, 0, 0, "", 2, 80005, "コッコロ", 0, 348);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 105801, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 3, 0, 0, "", 2, 80005, "ペコリーヌ", 0, 349);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 105901, "さすがでございます\nペコリーヌさま", 1, 0, 0, "", 2, 80005, "コッコロ", 0, 350);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (3, 106001, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 0, 0, "", 2, 80005, "キャル", 0, 351);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 106401, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 0, 0, "", 2, 80005, "シェフィ", 0, 352);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 105801, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 3, 0, 0, "", 2, 80005, "ペコリーヌ", 0, 353);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 105901, "さ、次はキャルさまの\n番でございますよ", 1, 0, 0, "", 2, 80005, "コッコロ", 0, 354);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 106001, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 0, 0, "", 2, 80005, "キャル", 0, 355);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 106401, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 0, 0, "", 2, 80005, "シェフィ", 0, 356);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 106001, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 0, 0, "", 2, 80005, "キャル", 0, 357);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 106001, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 0, 0, "", 2, 80005, "キャル", 0, 358);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 105901, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 1, 0, 0, "", 2, 80005, "コッコロ", 0, 359);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 106001, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 0, 0, "", 2, 80005, "キャル", 0, 360);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 105901, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 1, 0, 0, "", 3, 80005, "コッコロ", 0, 361);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 105801, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 0, 0, "", 3, 80005, "ペコリーヌ", 0, 362);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 105901, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 1, 0, 0, "", 3, 80005, "コッコロ", 0, 363);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 106401, "聖学祭…って、なにかしら？", 2, 0, 0, "", 3, 80005, "シェフィ", 0, 364);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 105901, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 1, 0, 0, "", 3, 80005, "コッコロ", 0, 365);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 106001, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 0, 0, "", 3, 80005, "キャル", 0, 366);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 106001, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 0, 0, "", 3, 80005, "キャル", 0, 367);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 105801, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 0, 0, "", 3, 80005, "ペコリーヌ", 0, 368);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 106001, "いや、そのまんますぎでしょ…", 0, 0, 0, "", 3, 80005, "キャル", 0, 369);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 106401, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 2, 0, 0, "", 3, 80005, "シェフィ", 0, 370);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 105801, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 0, 0, "", 3, 80005, "ペコリーヌ", 0, 371);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 106401, "えっ？　ええ…\nぎゅーっ…？", 2, 0, 0, "", 3, 80005, "シェフィ", 0, 372);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 106001, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 0, 0, "", 4, 80005, "キャル", 0, 373);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 106401, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 2, 0, 0, "", 4, 80005, "シェフィ", 0, 374);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 106001, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 0, 0, "", 4, 80005, "キャル", 0, 375);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 105901, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 1, 0, 0, "", 4, 80005, "コッコロ", 0, 376);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 106001, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 0, 0, "", 4, 80005, "キャル", 0, 377);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 105801, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 3, 0, 0, "", 4, 80005, "ペコリーヌ", 0, 378);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 106001, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 0, 0, "", 4, 80005, "キャル", 0, 379);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 106001, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 0, 0, "", 4, 80005, "キャル", 0, 380);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 106401, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 2, 0, 0, "", 4, 80005, "シェフィ", 0, 381);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 105801, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 3, 0, 0, "", 4, 80005, "ペコリーヌ", 0, 382);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 105901, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 1, 0, 0, "", 4, 80005, "コッコロ", 0, 383);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 106001, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 0, 0, "", 4, 80005, "キャル", 0, 384);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (12, 106401, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 2, 0, 0, "", 4, 80005, "シェフィ", 0, 385);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 105801, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 386);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 105801, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 387);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 105801, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 388);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 106001, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 0, 0, "", 5, 80005, "キャル", 0, 389);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 106001, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 0, 0, "", 5, 80005, "キャル", 0, 390);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 106401, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 2, 0, 0, "", 5, 80005, "シェフィ", 0, 391);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 105901, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 1, 0, 0, "", 5, 80005, "コッコロ", 0, 392);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 105801, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 393);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 106001, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 0, 0, "", 5, 80005, "キャル", 0, 394);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 105801, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 395);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 105801, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 396);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 105801, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 3, 0, 0, "", 5, 80005, "ペコリーヌ", 0, 397);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (4, 190801, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 2, 0, 0, "", 6, 80005, "カリン", 0, 398);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (5, 190801, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 2, 0, 0, "", 6, 80005, "カリン", 0, 399);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 106001, "…えっ！？", 1, 0, 0, "", 6, 80005, "キャル", 0, 400);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 105801, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 3, 0, 0, "", 6, 80005, "ペコリーヌ", 0, 401);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 106401, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 0, 0, "", 6, 80005, "シェフィ", 0, 402);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 105901, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 4, 0, 0, "", 6, 80005, "コッコロ", 0, 403);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 106401, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 0, 0, "", 6, 80005, "シェフィ", 0, 404);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 106001, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 1, 0, 0, "", 6, 80005, "キャル", 0, 405);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 105801, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 3, 0, 0, "", 6, 80005, "ペコリーヌ", 0, 406);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 106001, "ぶっ殺すぞ！？", 1, 0, 0, "", 6, 80005, "キャル", 0, 407);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (6, 190801, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 2, 0, 0, "", 6, 80005, "カリン", 0, 408);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 105901, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 1, 0, 0, "", 7, 80005, "コッコロ", 0, 409);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 106001, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 0, 0, "", 7, 80005, "キャル", 0, 410);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 106401, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 2, 0, 0, "", 7, 80005, "シェフィ", 0, 411);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 105801, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 3, 0, 0, "", 7, 80005, "ペコリーヌ", 0, 412);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 106001, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 0, 0, "", 7, 80005, "キャル", 0, 413);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 106401, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 2, 0, 0, "", 7, 80005, "シェフィ", 0, 414);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (16, 105901, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 1, 0, 0, "", 7, 80005, "コッコロ", 0, 415);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 106401, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 2, 0, 0, "", 7, 80005, "シェフィ", 0, 416);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (17, 105901, "もちろんでございます\n仲良くお勉強いたしましょう", 1, 0, 0, "", 7, 80005, "コッコロ", 0, 417);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 106001, "しれっと教育ママが\n生まれてる…？", 0, 0, 0, "", 7, 80005, "キャル", 0, 418);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 105801, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 3, 0, 0, "", 7, 80005, "ペコリーヌ", 0, 419);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 106001, "え～～～～！？", 0, 0, 0, "", 7, 80005, "キャル", 0, 420);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 106001, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 0, 0, "", 8, 80005, "キャル", 0, 421);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 106401, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 2, 0, 0, "", 8, 80005, "シェフィ", 0, 422);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (18, 105901, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 1, 0, 0, "", 8, 80005, "コッコロ", 0, 423);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 105801, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 3, 0, 0, "", 8, 80005, "ペコリーヌ", 0, 424);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 106401, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 2, 0, 0, "", 8, 80005, "シェフィ", 0, 425);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 106001, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 0, 0, "", 8, 80005, "キャル", 0, 426);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (19, 105901, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 1, 0, 0, "", 8, 80005, "コッコロ", 0, 427);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 106401, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 2, 0, 0, "", 8, 80005, "シェフィ", 0, 428);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 106001, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 0, 0, "", 8, 80005, "キャル", 0, 429);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 106001, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 0, 0, "", 8, 80005, "キャル", 0, 430);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 105801, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 3, 0, 0, "", 8, 80005, "ペコリーヌ", 0, 431);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 106001, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 0, 0, "", 8, 80005, "キャル", 0, 432);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 106401, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 433);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 106401, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 434);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 106401, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 435);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 106401, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 436);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 106401, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 437);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 106401, "それから、それから…！\nぅ、ぅぅっ…！", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 438);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 106401, "―びえぇぇ～んっ！！！", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 439);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (20, 105901, "どうされましたか、シェフィさま", 1, 0, 0, "", 9, 80005, "コッコロ", 0, 440);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 106401, "ううっ…ひっく…\nママッ…！", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 441);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (21, 105901, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 1, 0, 0, "", 9, 80005, "コッコロ", 0, 442);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (22, 105901, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 1, 0, 0, "", 9, 80005, "コッコロ", 0, 443);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 106401, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 0, 0, "", 9, 80005, "シェフィ", 0, 444);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (23, 105901, "主さま\n3.5周年まであと５日\nでございます", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 445);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (24, 105901, "ですがその前に\n生放送がありますね", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 446);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (25, 105901, "…生放送に向けた\n意気込みでございますか？", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 447);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 105901, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 448);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 105901, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 449);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 105901, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 450);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 105901, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 451);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 105901, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 452);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 105901, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 0, 0, "", 10, 80005, "コッコロ", 0, 453);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (26, 105801, "3.5周年まであと４日！\nやばいですね☆", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 454);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 106001, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 1, 0, 0, "", 11, 80005, "キャル", 0, 455);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (27, 105801, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 456);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (28, 105801, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 457);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (29, 105801, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 458);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 106001, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 1, 0, 0, "", 11, 80005, "キャル", 0, 459);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (30, 105801, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 460);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 105801, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 461);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 105801, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 462);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 106001, "だからあたしはやるなんて一言も…", 1, 0, 0, "", 11, 80005, "キャル", 0, 463);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 105801, "オイッスー☆", 0, 0, 0, "", 11, 80005, "ペコリーヌ", 0, 464);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 106001, "聞きなさいっての！！", 1, 0, 0, "", 11, 80005, "キャル", 0, 465);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (31, 106401, "3.5周年まであと３日…\nそして生放送は、明日…", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 466);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 106401, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 467);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 106401, "おいっす！\n…こうじゃなかったわね\nええと確か…", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 468);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 106401, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 469);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 106401, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 470);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (34, 105801, "やってますねシェフィちゃん！", 3, 0, 0, "", 12, 80005, "ペコリーヌ", 0, 471);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 106001, "なによ、考えることは\nみんな同じってこと？", 0, 0, 0, "", 12, 80005, "キャル", 0, 472);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (32, 105901, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 1, 0, 0, "", 12, 80005, "コッコロ", 0, 473);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 106401, "みんな…もちろんよ！", 2, 0, 0, "", 12, 80005, "シェフィ", 0, 474);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 105801, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 3, 0, 0, "", 12, 80005, "ペコリーヌ", 0, 475);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (7, 190801, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 2, 0, 0, "", 13, 80005, "カリン", 0, 476);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (8, 190801, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 2, 0, 0, "", 13, 80005, "カリン", 0, 477);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 105801, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 3, 0, 0, "", 13, 80005, "ペコリーヌ", 0, 478);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (9, 190801, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 2, 0, 0, "", 13, 80005, "カリン", 0, 479);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (33, 105901, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 4, 0, 0, "", 13, 80005, "コッコロ", 0, 480);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (10, 190801, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 2, 0, 0, "", 13, 80005, "カリン", 0, 481);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 106001, "大丈夫…大丈夫…\nあたしは大丈夫…", 1, 0, 0, "", 13, 80005, "キャル", 0, 482);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (11, 190801, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 2, 0, 0, "", 13, 80005, "カリン", 0, 483);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 106401, "あうー？", 0, 0, 0, "", 13, 80005, "シェフィ", 0, 484);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 105801, "あ…", 4, 0, 1, "105901,34,106001,38,190801,12", 13, 80005, "みんな", 0, 485);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 106001, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 1, 0, 0, "", 13, 80005, "キャル", 0, 486);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (35, 105901, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 4, 0, 0, "", 13, 80005, "コッコロ", 0, 487);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 105801, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 3, 0, 0, "", 13, 80005, "ペコリーヌ", 0, 488);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (13, 190801, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 2, 0, 0, "", 13, 80005, "カリン", 0, 489);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 106401, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 2, 0, 0, "", 14, 80005, "シェフィ", 0, 490);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 105801, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 3, 0, 0, "", 14, 80005, "ペコリーヌ", 0, 491);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 106001, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 0, 0, "", 14, 80005, "キャル", 0, 492);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (36, 105901, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 1, 0, 0, "", 14, 80005, "コッコロ", 0, 493);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 106401, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 2, 0, 0, "", 14, 80005, "シェフィ", 0, 494);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 105801, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 3, 0, 0, "", 14, 80005, "ペコリーヌ", 0, 495);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (37, 105901, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 1, 0, 0, "", 14, 80005, "コッコロ", 0, 496);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 106001, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 0, 0, "", 14, 80005, "キャル", 0, 497);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 106401, "へ、へぇ…", 2, 0, 0, "", 14, 80005, "シェフィ", 0, 498);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 105801, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 3, 0, 0, "", 14, 80005, "ペコリーヌ", 0, 499);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 106401, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 2, 0, 0, "", 14, 80005, "シェフィ", 0, 500);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 106401, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 2, 0, 0, "", 14, 80005, "シェフィ", 0, 501);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 105801, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 3, 0, 0, "", 15, 80005, "ペコリーヌ", 0, 502);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (42, 106001, "祝！", 1, 0, 0, "", 15, 80005, "キャル", 0, 503);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (38, 105901, "3.5周年！", 4, 0, 0, "", 15, 80005, "コッコロ", 0, 504);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 106401, "おめでとうございます！", 0, 0, 0, "", 15, 80005, "シェフィ", 0, 505);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (14, 190801, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 2, 0, 0, "", 15, 80005, "カリン", 0, 506);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (15, 190801, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 2, 0, 0, "", 15, 80005, "カリン", 0, 507);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 105801, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 3, 0, 0, "", 15, 80005, "ペコリーヌ", 0, 508);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 105801, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 3, 0, 0, "", 15, 80005, "ペコリーヌ", 0, 509);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (43, 106001, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 1, 0, 0, "", 15, 80005, "キャル", 0, 510);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 106001, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 1, 0, 0, "", 15, 80005, "キャル", 0, 511);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (44, 106401, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 0, 0, "", 15, 80005, "シェフィ", 0, 512);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (45, 106401, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 0, 0, "", 15, 80005, "シェフィ", 0, 513);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (39, 105901, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 4, 0, 0, "", 15, 80005, "コッコロ", 0, 514);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (40, 105901, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 4, 0, 0, "", 15, 80005, "コッコロ", 0, 515);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (41, 105901, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 4, 0, 0, "", 15, 80005, "コッコロ", 0, 516);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (45, 105801, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 3, 0, 0, "", 15, 80005, "ペコリーヌ", 0, 517);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (46, 105801, "これからも\nよろしくおねがいします！", 4, 0, 1, "105901,42,106001,45,106401,46,190801,16", 15, 80005, "みんな", 0, 518);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (1, 190804, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 0, "", 0, 60003, "カリン", 1, 519);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 1, 0, "", 0, 60003, "", 1, 520);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 1, 0, "", 0, 60003, "", 1, 521);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 1, 0, "", 0, 60003, "", 1, 522);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 2, 1, 0, "", 0, 60003, "", 1, 523);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 1, 0, "", 0, 60003, "", 2, 524);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 2, 0, "", 0, 60003, "", 1, 525);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 2, 0, "", 0, 60003, "", 1, 526);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, 2, 0, "", 0, 60003, "", 1, 527);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, 2, 0, "", 0, 60003, "", 1, 528);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 2, 0, "", 0, 60003, "", 2, 529);
INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 3, 0, "", 0, 60003, "", 1, 530);
