INSERT INTO `v1_0d550bb2467d606f5a34d3f7f2560982b18db95862186ffb874d02a7ee3fc01d` VALUES (0, 0, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 2, 3, 0, "", 0, 60005, "", 1, 586);
